    const [formData, setFormData] = useState({initialState});
    const {deckId} = useParams();

    useEffect(() => {
        async function loadData() {
            try {
                const data = await readDeck(deckId);
                setDeck(data)
            }
            catch(error) {
                console.log(error)
            }
        } 
        loadData();
    },[deckId])

